using System;
using System.Collections;
using System.Diagnostics;
using Assets.Scripts.OAuth2RefreshToken;
using Assets.Scripts.SpeechToText;
using Assets.Scripts.Translate;
using NUnit.Framework;
using Scripts.TextToSpeech;
using UnityEngine;
using UnityEngine.TestTools;
using Debug = UnityEngine.Debug;

namespace Tests
{
    public class TestScript
    {
        private static string API_KEY = "REPLACE_YOUR_GOOGLE_API_KEY";
        private static string ACCESS_TOKEN = "REPLACE_YOUR_ACCESS_TOKEN";

        [UnityTest]
        public IEnumerator T1_APIKey()
        {
            bool IsAsserted = false;

            GameObject go1 = new GameObject();
            FileLoader loader = go1.AddComponent<FileLoader>();
            loader.FileName = "APIKey.txt";
            loader.runInEditMode = true;
            loader.ContentsLoaded = new StringEvent();
            loader.ContentsLoaded.AddListener(apikey =>
            {
                Assert.AreNotEqual(apikey, API_KEY);
                API_KEY = apikey;
                IsAsserted = true;
            });

            // Wait for Assert result.
            while (!IsAsserted)
            {
                yield return null;
            }
        }

        [UnityTest]
        public IEnumerator T2_AccessToken()
        {
            bool IsAsserted = false;

            GameObject go2 = new GameObject();
            FileLoader loader = go2.AddComponent<FileLoader>();
            loader.runInEditMode = true;
            loader.FileName = "RefreshTokenParameters.json";
            loader.ContentsLoaded = new StringEvent();
            loader.ContentsLoaded.AddListener(contents => 
            {
                IsAsserted = true;
            });

            // load RefreshTokenParameters.json
            while (!IsAsserted)
            {
                yield return null;
            }

            // Init
            IsAsserted = false;
            RefreshToken refreshToken = go2.AddComponent<RefreshToken>();
            refreshToken.runInEditMode = true;
            refreshToken.OnNewAccessTokenReceived = new StringEvent();
            refreshToken.OnNewAccessTokenReceived.AddListener(newAccessToken =>
            {
                Assert.AreNotEqual(newAccessToken, ACCESS_TOKEN);
                ACCESS_TOKEN = newAccessToken;
                IsAsserted = true;
            });
            refreshToken.StartRefereshToken();

            // Wait for Assert result.
            while (!IsAsserted)
            {
                yield return null;
            }
        }

        [UnityTest]
        public IEnumerator T3_SpeechToText()
        {
            if (API_KEY.Equals("REPLACE_YOUR_GOOGLE_API_KEY"))
            {
                Debug.LogWarning("Dependency of T1_APIKey()");
                Assert.IsTrue(false);
                yield return null;
            }
            else
            {
                bool IsAsserted = false;

                GameObject go3 = new GameObject();
                SpeechToText stt = go3.AddComponent<SpeechToText>();
                stt.runInEditMode = true;
                stt.Base64DecodedContent = "";
                stt.APIKey = API_KEY;
                stt.OnTranscriptReceived = new StringEvent();
                stt.OnTranscriptReceived.AddListener(transcript => 
                {
                    Assert.AreEqual(transcript, "서울시 용산구 한강대로");
                    IsAsserted = true;
                });
                stt.StartSpeechToText();
                
                // Wait for Assert result.
                while (!IsAsserted)
                {
                    yield return null;
                }
            }
        }

        [UnityTest]
        public IEnumerator T4_Translate()
        {
            if (ACCESS_TOKEN.Equals("REPLACE_YOUR_ACCESS_TOKEN"))
            {
                Debug.LogWarning("Dependency of T2_AccessToken()");
                Assert.IsTrue(false);
                yield return null;
            }
            else
            {
                bool IsAsserted = false;

                GameObject go4 = new GameObject();
                Translate tts = go4.AddComponent<Translate>();
                tts.runInEditMode = true;
                tts.SourceText = "Unity의 실시간 3D 개발 플랫폼으로 여러분의 비전을 지금 바로 현실로 만드세요.";
                tts.AccessToken = ACCESS_TOKEN;
                tts.StartTranslate();
                tts.OnTranslatedTextReceived = new StringEvent();
                tts.OnTranslatedTextReceived.AddListener(translatedText =>
                {
                    Assert.IsTrue(translatedText.Contains("Make your vision a reality right now with Unity's real-time 3D development platform."));
                    IsAsserted = true;
                });

                // Wait for Assert result.
                while (!IsAsserted)
                {
                    yield return null;
                }
            }
        }

        [UnityTest]
        public IEnumerator T5_TextToSpeech()
        {
            if (API_KEY.Equals("REPLACE_YOUR_GOOGLE_API_KEY"))
            {
                Debug.LogWarning("Dependency of T1_APIKey()");
                Assert.IsTrue(false);
                yield return null;
            }
            else
            {
                GameObject go5 = new GameObject();
                TextToSpeech tts = go5.AddComponent<TextToSpeech>();
                AudioSource audioSource = go5.GetComponent<AudioSource>();
                tts.runInEditMode = true;
                tts.SourceText = "A UnityTest behaves like a coroutine in Play Mode";
                tts.APIKey = API_KEY;
                tts.StartTextToSpeech();

                // Wait for audio contents set to AudioClip.
                while (audioSource.clip == null)
                {
                    yield return null;
                }

                // You can hear tts.SourceText voice while audioSource.isPlaying
                while (audioSource.isPlaying)
                {
                    yield return null;
                }

                Assert.AreNotEqual(audioSource.clip, null);
            }
        }
    }
}
